(46, '14.8117', '14.8117', 'Bangka', 5, 'di dpn rmh rsponden ada rmh ksg, rmh ksg ini fs.nya sbg jemuran gmn ? Bsbtt ?', 'BSBTT dilihat dulu ukurannya, sama dengan atau lebih dari 10 meter persegi, maka 1 BF 1 BS, BSnya BSBTT.', 'umum', '4', '2017-02-22 16:49:55'),
(47, '14.8093', '14.8093', 'Bangka', 5, 'salah satu bs tidak jelas baik sls maupun batas, kata mitra itu sdh gak berlaku WBnya, bgaimna?', 'Tetap gunakan peta wb 2010, tetapi tanyakan lagi kepada sls batas yang ada di peta wb yang kamu pegang itu sekarang keberadaan batasnya bagaimana.', 'umum', '4', '2017-02-22 09:53:21'),
(48, '14.8206', '14.8206', 'Bangka', 6, 'Bangunan punya atap,dinding,dan lantai.Tapi dindingnya stngah. masuk BF? ', 'Jika tinggi dinding lebih dari setengah tinggi bangunan dan terdapat dinding di keempat sisi, maka menjadi bangunan fisik (Buped halaman 61, Konsep atap dan dinding)', 'umum', '4', '2017-12-22 03:07:30'),
(49, '14.8287', '14.8017', 'Bangka', 5, 'ruta bru sebulan tggl dsni, tp gatau akan tggl brp lama, jd gmn? apakah ttp d catat?', 'tanyakan lagi pada ruta tersebut apakah sampai tanggal 2 maret masih tetap tinggal disitu atau tidak\r\nkalau misalkan masih ada sampai tanggal 2 maret maka tetap dilisting\r\n', 'umum', '4', '2017-02-23 13:54:34'),
