(51, '14.8207', '14.8207', 'Bangka', 6, 'semua bangunan fisik yg ada, digambar semua di peta wb? kl ada 160 bf, semua digambar kecil2 y?', 'Benar. Jadi seluruh BF digambar di peta WB. Jika, kawasannya pemukiman padat penduduk maka gambarnya di peta WB nya disesuaikan ukurannya.', 'umum', '4', '2017-12-22 03:07:30'),
(52, '14.8206', '14.8206', 'Bangka', 6, 'jika warga tdk tau nmor RW baru,stiker yg ditulis dgn RW lama perlu diubah?', 'Sesuaikan dengan kondisi sebenarnya, tolong diubah ya gengs. Semangat ^^', 'umum', '4', '2017-12-22 03:07:30'),
