(63, '14.8427', '14.8427', 'Bangka', 6, 'ada bf banyak bstt campuran, stiker di pasang di yg terlihat kan? meskipun dia bsbtt?', 'Yang dipasang stiker ialah bstt, bstt campuran dan bstt tidak ditemui. Untuk bsbtt tidak dipasang stiker. Striker dipasang di tempat yang strategis dan mudah untuk dilihat dari luar. ', 'umum', '4', '2017-12-22 03:07:30'),
