(76, '14.8293', '14.8253', 'Bangka', 6, 'ada 1 BF, 2 Ruta, 11 ART, pengelolahan makanannya sama-sama. Itu masuk dimana ?', 'ingat konsep\r\n1 BF : atap, dinding, lantai\r\n1 Ruta : pengelolaan kebutuhan sehari-hari diurusi sendiri (tidak bergantung pada ruta lain) --> pengelolaan kebutuhan sehari-hari = makan, minum, tidur, pengambilan keputusan, dll\r\nART : yang pengelolaan kebutuhan sehari-hari ngikut/bergantung', 'umum', '4', '2017-12-22 03:07:30'),
(77, '14.8426', '14.8313', 'Bangka', 3, 'teman saya ada daftar pertanyaannya tidak muncul dan tidak ada pemberitahuan untuk update capi padahal yg lain dapat ', '', 'khusus', '1', '2017-02-22 13:13:00'),
(78, '14.8180', '14.8180', 'Bangka', 6, 'pda tgl 1 maret akan meningalkan wilayah maka masuk art atau bukan? ', 'Tanyakan niat ART apabila sudah ingin  menetap selama 6 bulan atau tidak. Apabila berniat menetap lebih dari 6 bulan maka masuk ke dalam ART', 'umum', '4', '2017-12-22 03:07:30'),
