(125, '14.8450', '14.8166', 'Bangka', 5, 'kalau misal dia tinggal disatu rumah, tapi makannya di rumah nya sendiri. tapi tidur dsb dirumah itu, jadi masuk apa ya rumah yg buat trmpat tidurnya aja?', 'Jika kedua rumah tersebut berada dalam 1 pekarangan maka, bangunan utama dikategorikan sebagai BSTT dan bangunan lainnya dikategorikan sebagai BSBTT.', 'umum', '4', '2017-02-23 05:49:02'),
(126, '14.8078', '14.8078', 'Bangka', 5, 'misal ada warung yg masih 1 pekarangan sama tempat tinggal dan warungnya itu gk ada dinding tapi penyangga2 aja itu masuknya bstt campuran atau 1 BF 2 BS ?', 'warung tsb bukan BF (ingat konsep BF)\r\nsehingga hanya ada 1 BF dan 1 BSTT\r\nkarena warung terpisah dari bangunan utama (satu pekarangan)', 'umum', '4', '2017-02-23 04:32:32'),
(127, '14.8321', '14.8321', 'Bangka', 5, 'ada rumah A dan rumah B. di rumah A ini ada bapak yg tinggal, di rumah B ada anaknya yg tinggal. si bapak ini pengelolaan makannya ikut anaknya. jadi bapak ini ikut art di rumah A atau B. terus status rumah A jd gimana? makasih', 'Pastikan terlebih dahulu siapa KRTnya. Probing dengan jelas (3 persayaratan) dan sudah ada di penegasan', 'umum', '4', '2017-02-23 04:39:48'),
(128, '14.8206', '14.8206', 'Bangka', 3, 'hasil listing pcl tdk terkirim ke kortim.. saat sinc jaringan/servel gagal', 'Server sedang cukup sibuk untuk saat ini karena ramai digunakan listing, silakan coba sync lagi terlebih dahulu. Apabila memang ingin menarik sampel bisa lakukan di device pcl terlebih dahulu saja', 'umum', '4', '2017-02-23 05:10:38'),
(129, '14.8203', '14.8203', 'Bangka', 4, 'Batas listing malam jam berapa ya? banyak yg gak ditemui kalau listing siang2.', 'batas listing malam jam 18.00 ya, jika dirasa perlu melakukan listing lebih dari itu, maka izin ke korwil dulu dan harus ada yang menemani (KSK, Mitra, Kadus, Warga setempat dll). tidak boleh hanya ditemani oleh mahasiswa(i). ', 'umum', '4', '2017-02-24 07:50:15'),
(130, '14.8432', '14.8432', 'Bangka', 5, 'adakah batasan tanggal untuk art jika ada kematian/kelahiran? misalkan: dihari listing/pencacahan ada yg lahir/mati', 'diingatkan kembali bahwa seluruh konsep umur pada listing dihitung per 2 maret 2017', 'umum', '4', '2017-02-23 06:14:13'),
(131, '14.8253', '14.8253', 'Bangka', 1, 'udah 3x samperin masih ditolak, gimana?', 'Minta bantuan pak rt untuk menemani melisting ke ruta tersebut, jika tidak bisa tanyakan info kepada tetangga.', 'umum', '4', '2017-02-23 06:14:54'),
(132, '14.8399', '14.8399', 'Bangka', 1, 'izin bertanya kalau untuk wilayah pemekaran dan bs kita masuk ke desa hasil pemekarannya, jadi alamatnya masuk yang udah mekar atau nggk?', 'Untuk penulisan alamat tuliskan alamat yang baru.', 'khusus', '4', '2017-02-26 00:30:08'),
(135, '14.8067', '14.8067', 'Bangka', 4, 'kemarin kan kalo ga salah biaya untuk ksk kan udah disediakan dari iuran kita yang 600k. kalo penunjuk jalannya ksk itu sendiri berarti uang penunjuk jalannya boleh dikasih ke bapak ksknya?', 'uang iuran untuk pendamping jalan 160k ya, siapapun penunjuk jalannya, uang tsb untuk dia no. ', 'khusus', '4', '2017-02-24 07:54:23'),
(136, '14.8139', '14.8366', 'Bangka', 1, 'ada 1 rumah isinya 1 cowok kurang waras, kerja cari uang tapi cuma buat mabuk. itu kan tetap dimasukan BF dan dilisting, tapi apakah bisa kalau nanti ga dipilih jdi sample? soalnya org sini juga pada takut.', 'ttep dimasukin fit. ', 'khusus', '4', '2017-02-23 11:09:58'),
(137, '14.8399', '14.8399', 'Bangka', 1, 'izin nanya, kalau peta gak proporsional, boleh kita buat gambar baru nggak?', 'buat baru yang seperti apa?? peta WB tidak boleh diubah hanya boleh diubah batas segmen-segmennya', 'umum', '4', '2017-02-23 07:35:57'),
(138, '14.8158', '14.8366', 'Bangka', 1, 'jadi di peta wb itu pernyataan dari mitra katanya salah gambar petanya, harusnya rumah si A masuk RT 2 dulu di 2010 tapi gak masuk di peta wb nya. saya ikut peta wb itu apa gimana? makasih ', 'Tetep ikut peta WB. PERUBAHAN RT tetep dicantumkan di WB', 'khusus', '4', '2017-02-23 11:01:22'),
(139, '14.7957', '14.7957', 'Bangka', 1, 'kalau panti asuhan gimana ya? 1 bf 1 bs? bstt/bsbtt?', 'termasuk ruta khusus, sehingga BSBTT', 'umum', '4', '2017-02-23 07:35:00'),
(140, '14.8049', '14.8006', 'Bangka', 1, 'Ini ada 4 rumah di tengah hutan lewat jalan setapak gt, kata pak kadus msh masuk RT 16. Ini di listing jg ga?', '', 'khusus', '1', '2017-02-23 07:49:25'),
