(142, '14.8335', '14.8369', 'Bangka', 1, 'bagaimana jika di suatu bstt (kontrakan) ditinggali tapi gantian dan ga sampai 6 bulan? dianggap bsbtt atau bstt?', '', 'khusus', '1', '2017-02-23 08:26:14'),
(143, '14.8427', '14.8427', 'Bangka', 5, 'satu bangunan, satu atap, ada 3 pintu dg masing2 ruang memiliki fungsi yg beda (dikontrakkan, tpa, pengurus masjid)', 'Mohon maaf yang ditanyakan apa ya??\r\nKalau kasus seperti itu :\r\nuntuk identifikasi bangunan : \r\nBF = 1\r\napabila sekat = 1 maka termasuk 1 BS\r\napabila sekat = 2 maka termasuk 3 BS', 'umum', '4', '2017-02-23 09:31:20'),
(144, '14.8093', '14.8093', 'Bangka', 1, 'ya pasti sudah penelusuran wilayah berkali2,  sudah petanya ke yg buat petanya, memang tidak sesuai', 'Jika memang sudah penelusan wilayah dan KSK setuju bahwa peta tidak sinkron dengan keadaan lapangan, boleh memperbaiki peta WB.', 'umum', '4', '2017-02-23 09:44:53'),
(145, '14.8427', '14.8427', 'Bangka', 1, 'ada toko, para pegawai tinggal disitu. gamau ditempel stiker karna milik bos, bos gatau kapan dtg. jadi bagaimana ya? bolehkah tidak ditempel stiker atau diberikan saja stikernya? gimana bos? ðŸ˜€', 'Tidak apa apa, tidak di tempel. Akan tetapi sebagai bukti mohon di foto toko tersebut, sebagai bukti apabila rumah tangga tersebut dijadikan sampel maka mudah untuk akses kesana lagi. Mohon pastikan lagi konsep ART.', 'umum', '4', '2017-02-23 09:45:25'),
(149, '14.8310', '14.8310', 'Bangka', 5, 'Ada 1 anak yg kebutuhannya (makan, sekolah, uang saku, dll)  dipenuhi ruta tsb, tetapi anak tsb tinggal & tdur di rumah lain. Apakah dia masuk listing ruta tsb?', 'Mohon maaf sebelumnya, si anak apakah ruta tempat tinggal si anak masih 1 BS dengan ruta yang memenuhi kebutuhannya tersebut??', 'umum', '4', '2017-02-23 09:47:46'),
(150, '14.8321', '14.8321', 'Bangka', 1, 'ada pcl yg kelupaan aturan untuk BF yg terlewat. jadi kan seharusnya ditambah huruf A(misal 003A), nah tapi di stiker dia nulisnya nomor BF selanjutnya. BS di tengah hutan dan harus diakses dengan motor cross. jadi solusinya gimana ya? makasih', 'Edit di CAPInya saja', 'umum', '4', '2017-02-23 10:41:08'),
(151, '14.8117', '14.8117', 'Bangka', 5, 'kita tdk bertemu dg RT yg mau kita listing, lalu kita mendptkan informasi dr tetangga ttg RT tsb, bolehkah kita jdkan statusnya sbg BSTT ? klo tdk brrti in last day listing harus revisit ?', 'Dijadikan BSTT tidak ditemukan. Untuk mengumpulkan informasi karakteristik ruta tersebut, lakukan revisit minimal 3 kali.', 'umum', '4', '2017-02-23 10:44:31'),
(152, '14.8012', '14.8207', 'Bangka', 1, 'Kalo perumahan baru, ada blok bloknya sendiri dari A-H. Gimana arah pelistingannya? Dia bentuknya kayak martabak dipotong-potong', 'Lakukan improvisasi bagaimana cara listing. Yang terpenting tidak ada lewat cacah maupun double cacah. Gunakan prinsip kemudahan akses.', 'umum', '4', '2017-02-23 23:06:54'),
(153, '14.8008', '14.8361', 'Bangka', 6, 'nanya dong, kalau ada ruta yang hanya punya 1 art dan dia bisu. kalau aku isi BSBTT gimana?', '', 'khusus', '1', '2017-12-22 03:07:30'),
(154, '14.8180', '14.8180', 'Bangka', 6, 'jika bs penomoran kelewat 1, itu gimana ya? biar gk mnghpus/mnganti semua', 'Silakan di edit satu per satuj', 'khusus', '4', '2017-12-22 03:07:30'),
(155, '14.8290', '14.8186', 'Bangka', 1, 'Assalamualaykum Warahmatullahi Wabarakatuh.. Maaf mau tanya, saya pas penentuan barat daya mengikuti stiker sensus ekonomi 2016. apakah boleh ? tapi penomoran stiker dan yang ditunjukkan KSK berbeda.', 'Waalaikumsalam Wr Wb.\r\nPerlu dipertimbangkan apakah sudah sesuai dengan konsep barat daya. Jika tidak sesuai lebih baik sesuai dengan konsep barat daya yang sudah diajarkan di kelas. ', 'umum', '4', '2017-02-23 14:51:04'),
(156, '14.7968', '14.8222', 'Bangka', 5, 'menantu yang kadang kadang tinggal satu rumah dan pengelolaan makannya gabung dengan mertuanya, tapi kadang kadang pulang ke rumah ibunya, dimasukkan ke ART mana? ', '', 'khusus', '1', '2017-02-23 12:01:42'),
