(162, '14.8228', '14.8228', 'Bangka', 1, 'kalo no bs bf di sticker salah dan itu udah jauh bgt tp blm nulis di capi, blh ganti nonya di capi aja?', 'Di capi ganti menjadi nomor yang benar kemudian perbaiki nomor yang ada di stiker', 'umum', '4', '2017-02-23 15:03:12'),
