(165, '14.8321', '14.8321', 'Bangka', 1, 'kalau RT di peta WB dan pengakuan responden beda ngikut yg mana?', 'Pastikan kepada SLS setempat. Apabila pengakuan responden sama dengan SLS, maka ikuti pengakuan responden.', 'umum', '4', '2017-02-23 23:02:23'),
(166, '14.8321', '14.8321', 'Bangka', 1, 'kalau RT di peta WB dan pengakuan responden beda ngikut yg mana?', 'Pastikan kepada sls setempat. Apabila pengakuan responden sudah sama dg sls maka ikuti pengakuan responden.', 'umum', '4', '2017-02-23 23:00:42'),
(167, '14.8321', '14.8321', 'Bangka', 1, 'kalau RT di peta WB dan pengakuan responden beda ngikut yg mana?', 'Tanyakan kepada Ksk/ketua sls / orang yang lebih mengetahui secara pasti mengenai nama RT tersebut. Jika langsung percaya responden khawatir beliau tidak mengetahui secara pasti. Untuk selanjutnya, ikuti nama berdasarkan ketua SLS/ ksk setempat. ', 'umum', '4', '2017-02-23 14:56:51'),
(168, '13.7849', '13.7849', 'Bangka', 5, 'Mess masuk bangunan ap? orangnya udh tinggal 6 bln, tpi diawal tujuannya g mau tnggal smp 6 bln', 'mess masuk BSTT', 'umum', '4', '2017-02-23 15:53:35'),
(169, '14.8352', '14.8352', 'Bangka', 1, 'jika setengah dari batas segmen hilang kita harus bagaimana? gatau dia masuk segmen kiri atau kanan', 'Bisa kirim gambar ke grup. Kami tidak bisa menjawab jika tidak ada gambarnya , khawatir tidak sesuai dengan yang dimaksud. ', 'umum', '4', '2017-02-23 14:59:49'),
