(171, '14.8178', '14.8178', 'Bangka', 1, 'misal ada 5 rumah petak (kontrakan) yg berjejer dengan satu atap. jika yg ditempatin hanya 2 rumah, maka penentuan bs untuk rumah petak yg belum diisi td bagaimana ?', '1 BF 3 BS. 2 BSTT, 1 BSBTT.', 'umum', '4', '2017-02-23 22:58:52'),
(172, '14.8025', '14.8178', 'Bangka', 1, 'kalau penghuni rumahnya tunggal dan tercatat sebagai krt di tempat lain, rumah/kontrakan yang dihuni dianggap sebagai bstt atau bsbtt atau apa?', '', 'khusus', '1', '2017-02-23 15:26:18'),
(174, '14.8089', '14.8006', 'Bangka', 5, 'kalau krt sekolah pesantren tp nggatau itu sederajat apa, lupa berapa tahun sekolah nya. itu masuk apa?', '', 'khusus', '1', '2017-02-23 15:41:07'),
(175, '14.8089', '14.8006', 'Bangka', 5, 'kalau krt sekolah pesantren tp nggatau itu sederajat apa, lupa berapa tahun sekolah nya. itu masuk apa?', 'Coba di dekati dengan umur responden saat bersekolah atau coba didekati dengan sekolah rakyat.', 'umum', '4', '2017-02-23 22:55:25'),
(176, '14.8089', '14.8006', 'Bangka', 6, 'kalo hapus salah satu listing apa yg akan terjadi?', '', 'khusus', '1', '2017-12-22 03:07:30'),
(178, '14.8025', '14.8178', 'Bangka', 5, 'kalo ada ruta yang membeli rumah didekatnya (>10m^2)  tapi udah reot gitu terus dijadiin gudang buat nyimpen semangka yang nantinya dijual sm ortunya (rumah ortu di seblah rumah ruta ini), gudang itu bf?', '', 'khusus', '1', '2017-02-23 15:58:33'),
(179, '14.8313', '14.8313', 'Bangka', 1, 'izin memastikan, kan jika bf & bs salah penomoran dan belum dimasukan ke capi, maka no.di stiker harus diganti ya. kalo sudah 90an ruta yg sdh dilist, apa tetap itu solusinya? maslahnya lingkungan tidak mendukng jika harus dlakukn revisi no.stikernya', 'Diperbaiki di capi. Karena di capi harus benar. Selesaikan terlebih dahulu beban listing dengan melanjutkan nomor yang benar. Jika beban listing sudah terselesaikan semua untuk 2 BS, maka perbaiki untuk di stiker. ', 'umum', '4', '2017-02-24 01:31:53'),
(180, '14.8223', '14.8267', 'Bangka', 5, 'Untuk sekolah... jika bangunannya terdiri dari 2 atau lebih bangunan dalam satu komplek sekolahan... itu BFnya sesuai jumlah bangunannya atau tetap dihitung 1 BF sekolah?', 'kompleks sekolah 1 bf, ', 'khusus', '4', '2017-02-23 22:41:42'),
(182, '14.7981', '14.7981', 'Bangka', 1, 'Melakukan listing ganda, salah satu sudah dihapus. Tapi no bf sama no bs jadi ada gap, jadi masalah atau engga? kalo mau diedit biar pas, udah terlanjur ditempel stikernya', 'perlu diedit lagi dicapi dan stickernya juga perlu diganti', 'umum', '4', '2017-02-23 17:04:48'),
(183, '14.8366', '14.8366', 'Bangka', 1, 'kalo ada rumah beda dinding satu atap blm ditinggali itu dihitung 1 bf 1bs atau gimana? ', 'pastikan lagi dindingnya, kalau misalkan dinding yang berbeda maka 2BF 2BS. ', 'umum', '4', '2017-02-24 01:15:53'),
(185, '14.8344', '14.7981', 'Bangka', 1, 'bagaimana strategi yang efisien dan efektif saat listing apabila terjadi hujan deras', 'siap2 dulu, berdoa hujan reda', 'khusus', '4', '2017-02-23 23:46:27'),
(186, '14.8004', '14.8004', 'Bangka', 1, 'Mau tanya donk kalo ada pcl listing pake papi trus malemnya dimasukin capi boleh nggk ? Apa har', 'diperbolehkan tetapi tetap memperhatikan aturan BF, BS, dan ruta', 'umum', '4', '2017-02-24 01:12:27'),
(187, '14.8366', '14.8366', 'Bangka', 1, 'dear intama, kalo udh kelar listing, boleh mulai nyacah hari ini? ', 'Revisit dulu untuk yang BSTT tidak ditemui. Pastikan lagi bahwa tidak ada yang terlewat cacah maupun dobel cacah. Pastikan juga batas-batasnya sudah benar. Pastikan isiannya sudah benar dan logis. Ini pemastiannya untuk 1 tim ya, bukan untuk masing\" PCL.', 'umum', '4', '2017-02-23 23:58:34'),
(188, '14.8178', '14.8178', 'Bangka', 1, 'kalau terlanjur salah menentukan nomor bs pada rumah petak (kontrakan), itu bagaimana ? karena penomoran ngefek ke penomoran bs selanjutnya ?', 'Salah menentukan nomor BS yang dimaksud bagaimana ya? Apakah terlewat BS atau dobel BS?', 'umum', '4', '2017-02-24 02:23:03'),
(190, '14.8089', '14.8006', 'Bangka', 5, 'kalo di peta wb ujung barat daya rumah A, tp sekarang ujung barat daya jadi rumah B (samping rumah A). jadi ujung barat daya nya yg mana?', '', 'khusus', '1', '2017-02-24 00:50:30'),
(191, '14.8178', '14.8178', 'Bangka', 1, 'misal di peta wb itu blok 014B terdiri atas ruta yg di rt 12. tapi ada satu rumah yg ternyata di rt 14. apakah satu rumah itu ttep masuk blok 014B ?', 'iya tetap masuk karena masih dalam satu Blok sensus.', 'umum', '4', '2017-02-24 01:10:36'),
(192, '14.8035', '14.8035', 'Bangka', 5, 'kalau misal kan SKTM buat podes hanya berupa estimasi dan banyak yg menggunakan sebagian besar hanya untuk dapat BPJS dan pendidikan gratis gimana?', 'apapun keperluannya, yg terpenting ialah seberapa banyak desa/kelurahan tsb mengeluarkan suratnya.', 'umum', '4', '2017-02-24 01:37:08'),
(193, '14.8101', '14.8101', 'Bangka', 5, 'kan batas bs nya di wb itu ngikuti batas sls, nah brrti klo batas sls nya ga sesuai dengan peta wb, ikutin yang di lapangan kan? ', 'Untuk batasnya sesuai dengan peta wb walaupun sekarang sudah berbeda sls', 'umum', '4', '2017-02-24 01:26:28'),
(196, '14.8035', '14.8035', 'Bangka', 5, 'waktu referensi untuk podes ada yg berbeda2, boleh?', 'usahakan tetap menggunakan time reference 2016, rentang nya januari 2016 hingga desember 2016. hanya itu yg bisa masuk blok isian\r\n\r\njika tidak, koordinasikan lagi ke suplemen atau yg bisa dihubungi di jarkom terkait keputusan yg akan dibuat', 'umum', '4', '2017-02-24 01:37:40'),
(197, '14.8017', '14.8017', 'Bangka', 5, 'kalo misal rumah tangganya nomaden,contoh anggota tni,belum menetap selama 1  bulan & ga tau bakal menetap 6 bulan atau ga,apakah kita listing?', 'tetap di listing, sesuai dengan konsep BF dan BS', 'umum', '4', '2017-02-24 01:33:58'),
(198, '14.8025', '14.8178', 'Bangka', 1, 'kan dibelakang rumah yang pinggir jalan ada gang masuk ternyata banyak ruta, cuma aku bingung, ini masuk BSku atau BS 001P', '', 'khusus', '1', '2017-02-24 01:22:44'),
(199, '14.8397', '14.8397', 'Bangka', 5, 'untuk mengerjakan listing harus urut dari segmen 1 > 2 > 3 > 4 atau boleh tidak urut dari 1> 2 > 4 > 3', 'Boleh tidak urut, disesuaikan dengan posisi barat daya.', 'umum', '4', '2017-02-24 01:34:13'),
(200, '14.8101', '14.8101', 'Bangka', 5, 'terus batas bs nya mengikuti apa? soalnya di lapangan gada jalan atau apapun yang bisa jadi tanda akhir bs', 'lihat dulu batasnya, batasnya belum tentu jalan. seuaikan dengan keadaan lapang ', 'umum', '4', '2017-02-24 01:46:00'),
(201, '14.7961', '14.8126', 'Bangka', 5, 'atap 2 rumah misah, tapi dinding pemisah nya 1 lapis, 1 BF atau 2 BF?', '', 'khusus', '1', '2017-02-24 01:50:06'),
(202, '14.8005', '14.8268', 'Bangka', 5, 'ada nenek kakek tinggal berdua, mereka kalo makan ke rumah anaknya tapi beda blok sensus. itu bagaimana ya? nenek ikut anak atau bagaimana?', '', 'khusus', '1', '2017-02-24 02:19:59'),
(210, '14.8310', '14.8310', 'Bangka', 5, 'Ada 1 anak pada 1 ruta yg kebutuhannya (makan, sekolah, dll) dipenuhi keluarga tsb, tetapi dia tinggal dan tidur di rumah (keluarga) lain yg masih 1 BS & beda segmen. perlakuan listingnya bagaimana ya?', '1 anak tersebut ikut satu ruta memenuhi kebutuhannya karena masih dalam satu blok sensus.\r\nKalau dia tinggal berbeda blok sensus maka masuk kedalam rumah tangga tempat dia tinggal', 'umum', '4', '2017-02-24 02:59:58'),
(211, '14.8310', '14.8310', 'Bangka', 5, 'Ada 1 ruta berisi nenek dan cucunya saja, kebutuhan hidup (dlm bntuk uang & makanan) dipenuhi anak si nenek yg tinggal diluar BS. Ini bagaimana u/ listingnya? Dijalankan seperti biasa?', 'iya tetap di listing sebagai satu rumah tangga\r\n', 'umum', '4', '2017-02-24 02:38:43'),
(212, '14.7973', '14.8117', 'Bangka', 5, 'rahma sini yaa...', '', 'khusus', '1', '2017-02-24 02:39:00'),
(213, '14.8345', '14.8345', 'Bangka', 5, 'Kalo ada nomor BF kelewat gimana? Misalnya 055 terus 057. 056 nya gak ada (hanya nomor aja yg kelewat.rumah tdk kelewat cacah). baru sadar setelah terlanjur banyak listing dan tempel stiker. solusinya?', 'Ini kasus khusus yang terjadi pada kamu, karena rumah tidak ada yang kelewat, jadi dipersilahkan untuk lanjut saja tetapi jangan sampai ada yang salah lagi dan harusnya bf bs tidak boleh salah', 'khusus', '4', '2017-02-24 03:43:06');
INSERT INTO `sipadu_daftar_pertanyaan` (`id`, `nim`, `nim_kortim`, `wilayah`, `kategori`, `pertanyaan`, `jawaban`, `golongan`, `status`, `timestamp`) VALUES
(215, '14.8178', '14.8178', 'Bangka', 1, 'kalau ada rumah yg ditinggali orang , tapi orang tsb makan dr rmh anaknya dan krt nya juga adlh anaknya, itu berarti masuk bs jenis apa ya ?', 'Karena orang tsb masuk ke art rumah yang lain, maka bangunan tsb masuk sebagai BSBTT', 'khusus', '4', '2017-02-24 03:47:58'),
(217, '14.8119', '14.8119', 'Bangka', 1, '[24/2 10.39] Aksi Nyata Bangun K: Kalau ada orang yang tinggal di 2 tempat\n[24/2 10.39] Aksi Nyata Bangun K: Terus katanya tinggal ya setengah setengah itu gmna?\n[24/2 10.40] Aksi Nyata Bangun K: Bahkan ditanya senin -jumat  masih jawab setengah sete', 'Maaf, pertanyaan kurang jelas. Harap dilengkapi', 'khusus', '4', '2017-02-24 04:10:31'),
(218, '14.7993', '14.7993', 'Bangka', 5, 'ada 1 bs yang segmen nya berisi perumahan di perkebunan kelapa sawit, yang tinggal disana orang2nya nomaden, ada yang seminggu, 3 bulan, ada juga 20 tahun tergantung berapa lama mereka kerja di perkebunan. nah apakah harus tetap di listing ?', 'Tetap harus dilisting semua bangunannya. Untuk keterangan mengenai rumah tangga (jumlah ART, pendidikan KRT, jumlah balita, dsb) tetap ditanyakan pada orang yang tinggal di bangunan tersebut bila BSTT, tidak peduli apakah tinggalnya nomaden atau tidak. Tanyakan sampai tanggal 2 Maret nanti apakah masih berada di rumah tersebut atau tidak.\r\nPastikan juga niatan untuk menetap minimal selama 6 bulan', 'khusus', '4', '2017-02-24 04:10:04'),
(219, '14.8203', '14.8203', 'Bangka', 5, 'Kalau penginapan yg di dalamnya ad orang nginap baru 1 hari masuknya bstt, bsbtt atau bsc ya?', 'Karena berencana hanya untuk liburan, masuk ke BSBTT', 'khusus', '4', '2017-02-24 03:56:39'),
(220, '14.7964', '14.7964', 'Bangka', 5, 'sekolah rakyat itu masuk apa ya', 'sekolah rakyat itu setara dengan SD\r\ntanyakan lama bersekolah untuk mengonfirmasi lagi (bila perlu)', 'umum', '4', '2017-02-24 04:29:55'),
(221, '14.8228', '14.8228', 'Bangka', 1, 'kalo rumah ada toilet diluar jadi 1 bf 2 bs apa 1 bf 1 bs?', 'Kalau toilet tersebut satu pekarang maka 1 BF 1BS', 'khusus', '4', '2017-02-24 06:24:26'),
(222, '14.8360', '14.8127', 'Bangka', 1, 'bagaimana kalau rumah tangga yang tinggal 1 orang saja tuli, tetangga tidak tau informasinya', '', 'khusus', '1', '2017-02-24 04:55:44'),
(224, '14.8253', '14.8253', 'Bangka', 5, '\"ayu\" artinya apa?', '\"ayuk\" artinya kakak buat perempuan, sahabat.', 'khusus', '4', '2017-02-24 07:51:52'),
(225, '14.8253', '14.8253', 'Bangka', 1, 'untuk 1234567 bahasa bangkanya apa?', '1 : seikok\r\n2 : due ikok\r\n3 : tige ikok\r\n4 : ampek ikok\r\n5 : lime ikok\r\n6 : anam ikok\r\n7 : tuju ikok\r\n8 : lapan ikok\r\n9 : sambilan ikok\r\n10 : sapuluh ikok\r\n\r\n(setau kami begitu, coba dikonfirmasi sama anak babel yak)', 'khusus', '4', '2017-02-24 06:32:32'),
(226, '14.8253', '14.8253', 'Bangka', 1, 'bapak suami istri ibu anak cucu  bibi om sepupu apa bahasa bangkanya?', 'suami : lakik\r\nistri : binik\r\nibu : ama/ame/umak\r\nanak : anak\r\nbibi : busu (bila bibi anak terakhir) / aci (bili bibi bukan anak terakhir)\r\nom : om', 'khusus', '4', '2017-02-24 06:45:03'),
(227, '14.8092', '14.8092', 'Bangka', 1, '[Fast Respon]\nAda kos2an dg 12 kamar. Ga ada orang lg pada pergi. Kamar tulisan kosong ada 3. Itu 1 bf 12 bs atau 1bf 10bs.', '1 BF 10 BS, yang tidak ada penghuninya dikategorikan jadi BSBTT.', 'khusus', '4', '2017-02-24 06:15:54'),
(228, '14.8410', '14.8410', 'Bangka', 5, 'kan ada bstt tidak ditemui nah itu tidak ditemuinya sampai listing selesai padahal ada nomor ruta,  itu harus di ganti bsbtt atau gimana? ', 'Sistem nomor ruta untuk bstt tidak ditemui yaitu menggunakan tag. Jadi jika akhirnya menjadi bsbtt maka nomor yang dibawahnya otomatis akan naik.', 'khusus', '4', '2017-02-24 06:27:25'),
(229, '14.8410', '14.8410', 'Bangka', 5, 'kan ada bstt tidak ditemui nah itu tidak ditemuinya sampai listing selesai padahal ada nomor ruta,  itu harus di ganti bsbtt atau gimana? ', 'pastikan dulu sampai terakhir listing (25 februari 2017) apakah rumah tangga tersebut ditemui apa tidak. Misalkan tidak ada tanyakan pada tetangga sekitar, apakah sampai tanggal 2 maret 2017 rumah tangga tersebut ada atau tidak. misalkan tidak ada maka dituliskan bsbtt. ', 'khusus', '4', '2017-02-24 06:48:43'),
(230, '14.8399', '14.8399', 'Bangka', 1, 'izin bertanya kalau ada rumah tangga yg baru tinggal 1 bln tp belum tau akan netap 6 bln apa lbh gmn?', 'untuk masalah ini tetap di listing', 'khusus', '5', '2017-02-24 15:43:25'),
(231, '14.7958', '14.8110', 'Bangka', 1, 'kalo ada kompleks pemerintahan kaya kantor, ada 5 gedung diitung 1 bf sebagai kompleks atau ada 5bf 5bs?', '', 'khusus', '1', '2017-02-24 08:02:31'),
(232, '14.7958', '14.8110', 'Bangka', 1, 'kalo ada kompleks pemerintahan kaya kantor, ada 5 gedung diitung 1 bf sebagai kompleks atau ada 5bf 5bs?', '', 'khusus', '1', '2017-02-24 08:02:38'),
(233, '14.8240', '14.8240', 'Bangka', 1, 'ada mess sebuah perusahaan, ada 15 bangunan, di listing gak ya ? apa ruta khusus?', 'tetap dilisting\r\nmess itu bukan ruta khusus', 'khusus', '4', '2017-02-24 09:12:53'),
(234, '14.8285', '14.8285', 'Bangka', 1, 'Ada kontrakan, ditinggalin oleh ruta, namun sedang pulang kampung sampai waktu yg tidak ditentukan. apakah itu termasuk bstt tak ditemukan atau langsung bsbtt?', 'pastikan lagi sampai tanggal 2 maret apakah rumah tangga tersebut pulang. apabila tidak pulang maka menjadi bsbtt ', 'khusus', '4', '2017-02-24 09:52:01'),
(235, '14.8285', '14.8285', 'Bangka', 1, 'jika kontrakan memang tidak ada yg menghuni, maka termasuk bsbtt?', 'Kategorikan sebagai BSTT tidak ditemui. Apabila sudah dapat dipastikan bahwa hingga tanggal 25 Februari 2017 tidak ada yang menghuni maka dikategorikan sebagai BSBTT.', 'khusus', '4', '2017-02-24 10:12:46'),
(236, '14.8285', '14.8285', 'Bangka', 1, 'jika kontrakan memang tidak ada yg menghuni, maka termasuk bsbtt?', 'Tanyakan terlebih dahulu ke pemilik kontrakan, jika tidak ada yang menempati maka termasuk bstt tidak ditemui. kemudian lakukan follow up tanggal 25 februari apabila tidak ada yang menempati maka menjadi bsbtt', 'khusus', '4', '2017-02-24 10:11:09'),
(237, '14.8397', '14.8397', 'Bangka', 5, 'apabila ada pcl salah melakukan penomoran BF dan BS namun sudah diperbaiki di cali oleh kortim, apakah perlu diperbaiki juga di stiker yg sudah terlanjur di tempel di rumah warga?', 'Sebaiknya diperbaiki. Nomor BF dan BS harus sinkron baik di CAPI maupun di stiker agar tidak membingungkan saat ingin menemukan ruta yang terpilih menjadi sampel.', 'khusus', '4', '2017-02-24 10:18:41'),
(238, '14.8397', '14.8397', 'Bangka', 5, 'apabila ada pcl salah melakukan penomoran BF dan BS namun sudah diperbaiki di cali oleh kortim, apakah perlu diperbaiki juga di stiker yg sudah terlanjur di tempel di rumah warga?', 'Perlu. Karena, penomoran BF dan BS di CAPI harus syncron dengan stiker. Hal ini bertujuan untuk memudahkan PCL pada saat melakukan pencacahan.', 'khusus', '4', '2017-02-24 10:18:13'),
(239, '14.8253', '14.8253', 'Bangka', 6, 'pemberitahuan dari capi itu kaya penegasan dll liatnya dimana ya?', 'pada menu beranda, di pojok kanan atas, yang disebelahnya menu pengaturan itu', 'umum', '4', '2017-12-22 03:07:30'),
(240, '14.8253', '14.8253', 'Bangka', 3, 'setiap buka pemberitahuan penegasan ramalan cuaca dll force close', 'Silakan relogin terlebih dahulu , pastikan sudah melakukan sinkronisasi dan kuesioner telah terkirim (jika masih ada yang menggantung / belum selesai)', 'umum', '4', '2017-02-24 13:00:06'),
(241, '14.8410', '14.8410', 'Bangka', 5, 'kan ada rumah kosong pas di tanya tetangga dia pergi ke batam jenguk saudara yang sakit pas ditanya besok katanya belum balik terua ditanya lagi kapan balik belum tau jadi gak pasti baliknya kapan,  nah ini gimana ya?  di masukkan ke apa?  ', 'Pastikan lagi pada saat hari terakhir listing untuk bertanya ke tetangga apakah ruta tersebut akan berada di rumah saat pencacahan. Jika iya, tanyakan kepada tetangga tersebut mengenai keterangan dan informasi listing yang dibutuhkan.', 'khusus', '4', '2017-02-24 11:00:18'),
(242, '14.8006', '14.8006', 'Bangka', 1, 'lulusan pesantren, jika responden tidak tahu pesantren itu sederajat apa , tidak punya kk,how?', 'Tanyakan dengan pendekatan pada umur berapa responden lulus dari pesantren tersebut, atau lamanya responden sekolah di pesantren tersebut. Jika memungkinkan dan pesantren tersebut berada di BS yang sama. Bisa di cek langsung ke pihak pesantren untuk mengetahui jawaban yang pasti', 'khusus', '4', '2017-02-24 12:25:59'),
(243, '14.8253', '14.8253', 'Bangka', 6, 'BS pclku beririsan dengan BS terpilih susenas, dia ditanyain kenapa listing terus, dan takutnya nanti pas pengambilan sampel responden akan menolak apabila pernah diwawancarai sebelumnya', '', 'khusus', '2', '2017-12-22 03:07:30'),
(244, '14.8253', '14.8253', 'Bangka', 1, 'info pencacahan kita dari 26 feb-1mar pencacahan susenas 1-7mar bisa gak diatur jangan sampai sama sampelnya?', 'Susenas menggunakan rancangan sampel probabilitas sehingga sampel yang terpilih tidak bisa diatur', 'khusus', '4', '2017-02-26 02:45:25'),
(245, '14.8248', '14.8248', 'Bangka', 1, 'Apabila listing BS pertama tidak selesai dalam 2 hati, apakah hari ke 3 melanjutkan bs pertama atau ganti bs kedua, dgn konsekuensi bs pertama tidak lengkap?', 'Sebisa mungkin selesaikan dulu bs pertama baru selesaikan bs kedua. Supaya tidak terjadi kebingungan saat penomoran dan pendataftaran ruta ^^', 'khusus', '4', '2017-02-24 12:09:35'),
(246, '14.8397', '14.8397', 'Bangka', 5, 'kalau rumah utama terpisah dengan dapur/wc/garasi/toko/gudang itu termasuk 1BF 1BS atau sudah beda BF?', 'Jika masih dalam satu pekarangan (ada di sekitar rumah utama dan dibatasi pagar) maka dianggap bagian dari bangunan rumah utama tersebut --> 1 BF 1 BS *1 BS jika dapur/wc/garasi/toko tidak mempunyai pintu keluar masuk sendiri', 'khusus', '4', '2017-02-24 12:16:49'),
(247, '14.8397', '14.8397', 'Bangka', 5, 'di dalam 1 BF tinggal 2 keluarga (orang tua + menantu). mereka bekerja masing masing tapi patungan untuk makan sehari hari. apakah 1ruta atau 2 ruta?', 'Jika jika pemenuhan kebutuhan sehari-hari ditanggung salah satu keluarga (orang tua atau menantu) maka 1 ruta. Namun jika kebutuhan sehari2 ditanggung keluarga sendiri2 maka 2 ruta.', 'khusus', '4', '2017-02-24 12:36:29'),
(248, '14.8397', '14.8397', 'Bangka', 5, 'terlalu banyak perubahan pada peta wb sehingga hanya pcl yang bersangkutan yg mengerti gambarnya. apakah peta wb dikembalikan ke BPS?', 'Dikembalikan ke kortim. Untuk tindak lanjutnya bagaimana, tunggu jarkom selanjutnya kawan.', 'khusus', '4', '2017-02-24 12:29:28'),
(249, '14.8176', '14.8113', 'Bangka', 3, 'tiap kali ada pemberitahuan dan ingin membukanya, langsung muncul tulisan \"capi berhenti\", why?', '', 'khusus', '1', '2017-02-24 11:40:10'),
(250, '14.8176', '14.8113', 'Bangka', 3, 'tiap kali ada pemberitahuan dan ingin membukanya, langsung muncul tulisan \"capi berhenti\", why?', '', 'khusus', '1', '2017-02-24 11:40:12'),
(251, '14.8399', '14.8399', 'Bangka', 1, 'izin bertanya, kalau tinggal disananya blom sebulan dan berniat pindah dalam wkt dekat atau gak smpe 6 bulan paling tinggal disitu, nggk termasuk rumah tangga?', 'Termasuk rumah tangga. Tetap dilisting bangunannuandan keterangan rutanya.', 'khusus', '5', '2017-02-24 15:43:25'),
(252, '14.8399', '14.8399', 'Bangka', 1, 'izin bertanya lagi, kasusnya 2 rumah, rumah pertama selalu menerima makan dr rumah 1.. ini karena yg rumah 2 itu org tua yg 1.. jadi ada 2 bf 2 bs dan 1 ruta, rutanya masuk mana?', 'Rutanya masuk ke rumah tangga yang menanggung kebutuhan sehari-hari', 'khusus', '5', '2017-02-24 15:43:25'),
(253, '14.8399', '14.8399', 'Bangka', 1, 'izin bertanya lagi, kasusnya 2 rumah, rumah pertama selalu menerima makan dr rumah 1.. ini karena yg rumah 2 itu org tua yg 1.. jadi ada 2 bf 2 bs dan 1 ruta, rutanya masuk mana?', 'art nya masuk ke ruta yang memenuhi kebutuhan sehari-hari (dimasukkan ke rumah 1)', 'khusus', '5', '2017-02-24 15:43:25'),
(254, '14.8321', '14.8321', 'Bangka', 5, 'anak yg kerja di pangkal pinang terus pulang seminggu sekali ga masuk art kan?', 'tidak masuk sebagai krt (ada di buku pedoman listing) ^^', 'khusus', '4', '2017-02-24 12:57:27'),
(255, '14.8285', '14.8285', 'Bangka', 1, 'jika ruta sangat sulit ditemui, tapi saat hari terakhir listing kebetulan bisa ditemui. apakah saya bisa mempertimbangkan mengubah menjadi bsbtt karena dikhawatirkan ketika terpilih menjadi sampel saat pencacahan sulit ditemui? ', 'tidak bisa. harus bstt. ', 'khusus', '4', '2017-02-24 14:10:39'),
(256, '14.8093', '14.8093', 'Bangka', 3, 'pcl saya tidak bisa sinkron, sudah dicoba berkali2, bagaimana?', 'Saat ini server memang sedang sibuk karena baru pada menginput ke capi yang sebelumnya menggunakan papi, bisa dicoba setiap beberapa menit seterusnya begitu. Pastikan juga settingan pclhostnya sudah benar (https://pkl56.stis.ac.id/service)', 'umum', '4', '2017-02-24 15:00:03'),
(257, '14.8178', '14.8178', 'Bangka', 1, 'misal pd hari 1 sgmen s010 udh slesai n lnjut ke sgmen lain, tapi trnyata di hr ke2 btasnya berbah shg ada puluhan rumah di s010 yg terlewat ,terus  penomoran bf dan bs nya bagaimana ? mohon solusinya', 'Bagaimana batas bisa berubah? harap dijelaskan lebih lanjut', 'khusus', '4', '2017-02-24 14:16:32'),
(258, '14.8186', '14.8186', 'Bangka', 1, 'Di peta wb, rumah patokan itu masuknya ke RT 004, trus setelah di probing dia masuknya ke RT 002 semenjak 2010. itu bermasalah tidak kalo dia dimasukin ke RT 002?', 'Sesuaikan dengan batas BS saja. Alamat diisikan sesuai dengan SLS terbaru', 'khusus', '4', '2017-02-24 14:19:48'),
