(260, '14.8437', '14.8437', 'Bangka', 1, '(Want TO ASK)\n1.Ada 1 pcl dengan beban tugas 2 BS yg blm selesai (padahal udah dilembur sampe skrng blm plg) trus bsk kortim ga bisa bantu dia karna harus nganterin pcl lain dg BS terpisah lebih dr 20km dg dg desa ditengah hutan dan pcl gabisa naik m', 'Mungkin bisa minta bantuan ke teman dari tim lain yang bebannya sudah terselesaikan *jika ada. Maaf jika jawaban kurang memuaskan ^^', 'khusus', '4', '2017-02-24 23:23:47'),
