(262, '14.8119', '14.8119', 'Bangka', 1, 'ada rumah satu atap, ada tiga pintu pisah, satu kamar buat ortu, satu kamar buat anak, satu buat gudang, jadi itu berapa bs?', 'Yang dimaksudkan disini 3  pintu terpisah apakah pintu keluar ke pekarangan? Apabila iya maka menjadi 1 BF 3 BS ', 'khusus', '4', '2017-02-24 15:30:39'),
(263, '14.8119', '14.8119', 'Bangka', 1, '(Pertanyaan Sebelumnya)\r\nQ : ada rumah satu atap, ada tiga pintu pisah, satu kamar buat ortu, satu kamar buat anak, satu buat gudang, jadi itu berapa bs?\r\nA : Yang dimaksudkan disini 3  pintu terpisah apakah pintu keluar ke pekarangan? Apabila iya maka menjadi 1 BF 3 BS  \r\n\r\n\r\nlanjut pertanyaan tadi, yg lain dianggap bsbtt?', '(kasus di belitung)\r\nRumah dengan 2 pintu dan fungsinya sebagai kamar sebenarnya adalah 1 rumah krn menyambung, hanya saja dibuatkan 2 pintu keluar, namun aktivitas sehari-hari dilakukan bersama di rumah tersebut . Krna fungsinya sama-sama untuk keluar/masuk sehari-hari, golongkan 1BF 1BS\r\n\r\nYang dianggap BSBTT : gudang', 'khusus', '4', '2017-02-24 22:56:01'),
(264, '14.8320', '14.8156', 'Bangka', 6, 'boleh tukeran yang lebih layak ga? sama mereka yang lebih sering ketemu sama jalan aspal. (re: yang kerjanya sering di posko). TERIMA KASIH', '', 'khusus', '1', '2017-12-22 03:07:30'),
