(266, '14.7941', '14.8207', 'Bangka', 1, 'bagaimana jika saat listing ada nomer bf dan bs  yang terlewat di capi? misal setelah 8 seharusnya 9 namun salah input menjadi 10, dan baru menyadari saat nomer bf dan bs sudah mencapai ratusan', 'Misalkan yang salah itu penentuan bstt atau bsbtt mohon rumah tangga nya diganti. Akan tetapi misalkan yang salah penentuan BF BS lanjutkan aja listingnya. Terimakasih', 'khusus', '4', '2017-02-24 22:46:38'),
(267, '14.8313', '14.8313', 'Bangka', 3, 'ketika buka \'pertanyaan saya\' selalu force close. kenapa ya?', 'Sudah menggunakan capi versi terbaru? Pastikan telah update versi CAPI nya, kalau masih seperti itu, bisa logout terus relogin terlebih dahulu . Pastikan data yang ada telah di sync dan kuesioner telah dikirim sebelum logout', 'khusus', '4', '2017-02-24 17:53:16'),
(268, '14.8388', '14.8388', 'Bangka', 1, 'jk jwbn responden sls nya beda dg d wb, dan ketika d tnyakan ke rt nya trnyta jawabn rt beda dg peta wb dan responden, ketika d tnya ke rt, pak rt bilang bebrpa thun lalu mmg baru d gnti. d wb tertulis rt 1 tp pk rt bilang rt 4 trs bgaimn? ', 'Ikuti jawaban pak RT nya', 'khusus', '4', '2017-02-24 22:31:21'),
