(272, '14.8305', '14.8017', 'Bangka', 5, 'ada ibu yang gamau diakui tinggal di rumah tsb, tinggal terpisah sama suami, padahal seharinya masak disitu buat anaknya yg msh sekolah, ibu itu blg dia udh pindah kk, krn anaknya sekolah disitu makanya dia masak disitu buat anaknya. jadinya gmn?', 'Mohon tanyakan lagi ibu itu tinggal dan tidur dimana? Apakah sehari-hari ibu itu cuma masakin anaknya. Sumber bahan buat masak itu apakah dari uang bapak atau si ibuk? Jika uang bapak maka si ibu bukan termasuk ART disitu', 'khusus', '4', '2017-02-25 01:07:46'),
(274, '14.8305', '14.8017', 'Bangka', 5, 'ada warung yang menempel dgn rumah, tapi beda pintu masuk rumah dgn warung, tetapi ada pintu yg menghubungkan rumah dengan warung, dihitung 1BF 2 BS?', '1 bf 1 bs', 'khusus', '4', '2017-02-25 10:02:08'),
(275, '14.8132', '14.8033', 'Bangka', 5, 'mau tanya, kalau misalkan ada rumah yg ditinggali oleh nenek sendirian, dia sakit2an berbaring di kasur dan makannya mendapatkan bntuan dari tetangga sekitar,  itu tetap dicatat atau tidak? ', 'Tetap dicatat dan di listing. Maksudnya disini sakit2 an apakah dia masih bisa bekerja sendiri? Apabila masih bisa maka tetap di catat sebagai rumah tangga sendiri.', 'khusus', '4', '2017-02-25 01:09:51'),
(276, '14.8132', '14.8033', 'Bangka', 5, 'mau tanya, kalau misalkan ada rumah yg ditinggali oleh nenek sendirian, dia sakit2an berbaring di kasur dan makannya mendapatkan bntuan dari tetangga sekitar,  itu tetap dicatat atau tidak? ', 'Tetap dicatat dan di listing. Maksudnya disini sakit2 an seperti apa?? \r\nApakah si nenek masih bisa untuk bekerja walaupun dia sering mendapatkan bantuan dari tetangga nya maka nenek tsb termasuk ruta sendiri', 'khusus', '4', '2017-02-25 01:11:58'),
(277, '14.8013', '14.8240', 'Bangka', 3, 'kalau ada pemberitahuan tdk bisa dilihat  secara lengkap, diatas udah dijawab tapi udh dicoba ttp gk bisa.gmna ya ?', 'Tidak bisa dilihatnya seperti apa ya? di bagian notif masih gak bisa? Muncul sebagian (kepotong) ? Itu dibuka di perangkat apa ya? Coba dilihat di tablet', 'umum', '5', '2017-02-25 06:42:53'),
