(280, '14.8139', '14.8366', 'Bangka', 5, 'keluarga dgn bapak A dan ibu B, di A bekerja sebagai buruh bebas di kebun orang dan juga merawat kebun sendiri, pekerjaan utama si A jadinya apa? dari sisi pendapatan lebih banyak sebagai buruh. ', 'buruh', 'khusus', '4', '2017-02-25 02:08:29'),
(281, '14.8340', '14.8168', 'Bangka', 5, 'ada rumah yang pemiliknya sudah meninggal, anaknya suka berkunjung sesekali; sekitar setengah tahun sekali, dan menetap hanya seminggu, rumah tsb apakah termasuk bsbtt?', 'bsbtt', 'khusus', '4', '2017-02-25 02:07:37'),
(282, '14.8139', '14.8366', 'Bangka', 5, 'kan ada ibu B, nah si ibu seminggu terakhir tidak bekerja (mengurus rumah tangga) namun sebenarnya ibu B bekerja sbg pkerja keluarga tanpa dibayar di kebun milik suami, jadi pekerjaan utama ibu apa? apakah bkerja kbun sbg pkerja kluarga?', 'pekerja keluarga', 'khusus', '4', '2017-02-25 02:11:16'),
(283, '14.8139', '14.8366', 'Bangka', 5, 'ada 1 bangunan yang 1 atap, namun beda dinding jadi 2 bangunan A dan B. yang A bangunan tmpt tinggal dulu dan bengkel. yg B rumah baru dibangun. 1 atap. Statusnya apa? BF, BS nya? ini 1 kluarga. ', '1 bf 1 bstt campuran ', 'khusus', '4', '2017-02-25 02:09:34'),
(284, '14.8139', '14.8366', 'Bangka', 1, 'kalo tmpat jualan yg beratap daun kering gitu, lantai tanah, trus dinding dri bambu tapi hanya sebgian krn fungsinya warung sore. jauh dri rumah. ini 1 BF (BSBTT) ? atau tidak dicatat sbg bangunan?', 'dindingnya berapa sisi? kalo cuma 3 sisi gak dihitung bf', 'khusus', '4', '2017-02-25 02:10:31'),
