(288, '14.8166', '14.8166', 'Bangka', 1, 'ijin bertanya. kalau jumlah ruta di peta wb 2009 sama yg dilisting sekarang berkurang wajar gak? soalnya udah muterin. terima kasih. mohon jawabannya', 'wajar, karena keadaan 2009 berbeda dengan 2017 mungkin saja ada yang pindah', 'khusus', '4', '2017-02-25 04:29:51'),
