(290, '14.8006', '14.8006', 'Bangka', 5, 'di penegasan 4-2 blm ada. kl ad rumah&warung terpisah tdk ad pnghubung,1 bf 2 bs dgn syarat warung >10m^2 kan y? tp klo < jadinya 1 bf 1 bs kan ya? nah, rumahnya masuk BSTT/BSTT Campuran ? soalny kn dia punya warung tp gk dihitung bs ', 'kalau yang kasus yang pertama rumah termasuk bstt dan warung bsbtt. Akan tetapi untuk kasus ke dua rumah termasuk bstt campuran.', 'umum', '4', '2017-02-25 03:12:10'),
