(343, '14.8313', '14.8313', 'Bangka', 3, 'maaf mau tanya ya, tadi saya sdah ambil sampel,  dan sudah tau 10 ruta yg jadi sampelnya tapi kok ini pas buka capi lagi status nya balik finalisasij listing ya? dan sampel yg terpilih tadi sdah hilang.', 'ini diambil di kortimnya ya? udah selesai sync nya setelah ambil sampel? Kalau iya dan masih tidak muncul, ikuti petunjuk yang di grup FAQ CAPI ya', 'khusus', '4', '2017-02-26 03:40:15'),
