(357, '14.8021', '14.8021', 'Bangka', 5, 'Kalo nelayan kerja 4 hari di laut gak pulang jam kerjanya gmn? trs dia juga 3 hari lain (pas gak ke laut) berkebun nah kan itu jadi pekerjaan tambahan jam kerja totalnya gmn?', 'pekerjaan utama : nelayan, jam kerjanya perhari 16 jam (jam kerja maksimal) untuk 4 hari\r\npekerjaan keseluruhan : 4 hari jadi nelayan dan 3 hari dia berkebun (tanyain dulu jam kerjanya saat berkebun)\r\nmisal : senin - kamis : 16 jam (nelayan)\r\njumat - minggu : jam kerja di kebun', 'khusus', '4', '2017-02-26 06:31:55'),
