(472, '14.8006', '14.8006', 'Bangka', 5, 'masih >6 tahun, masih tk, tulis apaa? ', 'Pada rincian 504 tuliskan tidak atau belum pernah sekolah', 'khusus', '4', '2017-02-28 01:55:05'),
(473, '14.8006', '14.8006', 'Bangka', 5, 'masih >6 tahun, masih tk, tulis apaa? ', 'Tetap masukkan ke pra sekolah\r\nLalu di bagian bersekolah tulis belum bersekolah', 'umum', '4', '2017-02-27 23:55:01'),
(474, '14.8345', '14.8345', 'Bangka', 5, 'kalau responden benar2 tidak tahu besarnya dana BOS. Solusinya?', 'Diinputkan beasiswa/bantuan setahunya saja dan tetap tulis di catatan bahwa responden tdk tahu besaran bos\r\nNnti akan diusahakan di skpd', 'khusus', '4', '2017-02-27 23:52:41');
INSERT INTO `sipadu_daftar_pertanyaan` (`id`, `nim`, `nim_kortim`, `wilayah`, `kategori`, `pertanyaan`, `jawaban`, `golongan`, `status`, `timestamp`) VALUES
(475, '14.8112', '14.8203', 'Bangka', 5, 'seseorang dengan pekerjaan utama tukang cuci, tiap bulan mencuci untuk 3 ruta (A,B,C). Setiap bulan mendapat upah dari ketiga ruta tsb 300rb dr tiap ruta. Status pekerjaan termasuk berusaha sendiri atau sbg buruh? ', 'Buruh (pekerja bebas karena memiliki lebih dari 1 majikan dalam satu bulan)', 'umum', '4', '2017-02-27 23:56:30'),
(476, '14.8437', '14.8437', 'Bangka', 5, 'Biasanya bekerja tambang tapi 1minggu yg lalu mesin rusak trus kerja kebon,  pkrjaan utama apa? ', 'jadi waktu terbanyak yg digunakan untuk bekerja dalam seminngu yg lalu itu kebun kan ?\r\nitulah yg jadi pekerjaan utama', 'khusus', '4', '2017-02-28 00:45:03'),
(477, '14.8340', '14.8168', 'Bangka', 5, 'jika ruta memiliki usaha warung nasi, dan konsumsi ruta tsb digabung dengan masakan yang akan dijual, bagaimana mengisi modul konsumsinya?', 'dikira kira berapa yang di konsumsi rumah tangga tersebut diluar yang di warung, jadi harus diinputasi', 'umum', '4', '2017-02-28 00:52:51'),
(478, '13.7480', '13.7480', 'Bangka', 6, 'rantai motor kendor, lampu mati, di bengkel deket sini (membalong, kembiri) sparepart ga ada, info bengkel honda / ahass di belitung ya, beserta jam buka tutup nya', 'Jalan Sriwijaya No.123A, Tanjung Pandan, Tj. Pandan, Kabupaten Belitung, Kepulauan Bangka Belitung 33411, Indonesia', 'umum', '4', '2017-12-22 03:07:30'),
(479, '14.8203', '14.8203', 'Bangka', 2, 'Kalau responden menolak gimana? udah didatangi 2 kali dan tetap menolak', 'usahakan sampai terakhir pencacahan tetap di coba ya. :) fokus yang lain dulu ya.', 'khusus', '4', '2017-02-28 03:15:40'),
(480, '14.8178', '14.8178', 'Bangka', 5, 'untuk bunga deviden , jika responden tidak tahu brapa bunga yg diperoleh, itu bagaimana ?', 'Jika responden tidak tahu bunga yang didapat, probing lebih lanjut untuk mengetahui jumlah tabungannya. Tanyakan responden menabung di bank mana. Selanjutnya bisa dilihat suku bunga di lampiran buku pedoman pencacahan. Kalikan tabungan dengan suku bunga bank. Terima kasih', 'khusus', '4', '2017-02-28 02:58:16'),
(481, '14.7964', '14.7964', 'Bangka', 5, ' kalau ga ada orang yg sekolah persepsi biaya kebutuhan pendidikan diisi apa ya?', 'Pilih kurang cukup. Tulis keterangan tidak terdapat ART yang bersekolah.', 'khusus', '4', '2017-02-28 04:04:44'),
(482, '14.7964', '14.7964', 'Bangka', 5, ' kalau ga ada orang yg sekolah persepsi biaya kebutuhan pendidikan diisi apa ya?', 'kurang dari cukup. dan dituliskan di catatan gak ada yang sekolah', 'khusus', '4', '2017-02-28 03:50:20'),
(484, '14.8099', '14.7981', 'Bangka', 6, 'ku udah kelar 2 ndre sekarang bingung sinar manik udah nggak ada lagi yang bisa ditanyai pada kosong rumahnyaaa. aku sama eka ke telak atau gimana ini?', 'ke penginapan sini, aku anter ke telak', 'khusus', '4', '2017-12-22 03:07:30'),
(486, '14.8310', '14.8310', 'Bangka', 2, 'Apakah kortim bisa mendownload ulang kuesioner dari PCL (monitoring), kuesioner yg didownload akan terduplicate atau tidak?', 'tidak akan terduplikasi, yang kalian periksa pasti yang kalian bisa download dari menu monitoring', 'umum', '4', '2017-03-01 03:17:52'),
(487, '14.8285', '14.8285', 'Bangka', 5, 'saat listing ada 6 art, ternyata senin malam 3 art pindah ke pangkalpinang untuk menetap. sehingga hanya mencacah 3ruta yg menetap skrg. apakah diperbolehkan?', 'Cacah 3 ART yang ada sekarang', 'khusus', '4', '2017-02-28 04:39:52'),
(488, '14.8060', '14.8060', 'Bangka', 5, 'responden menolak diwawancarai, udah bawa SLS, pakai PDA, bahkan nunjukin surat pun tetap nolak. Itu gimana? boleh nonres? udah 5 kali revisit. bahkan udah bawa 1 tim', 'lanjutkan ke ruta yang lain dulu\r\nsambil berdoa supaya tidak nonrespons\r\n\r\ndirevisit paling akhir\r\ncoba ganti pencacah (pcl atau kortim yang bisa cepat beradaptasi dan komunikasi dengan bahasa bangka)', 'umum', '4', '2017-02-28 06:09:04'),
(489, '14.8243', '14.8267', 'Bangka', 1, 'kalo kerjanya serabutan itu masuk kategori mana?', '', 'khusus', '1', '2017-02-28 09:52:55'),
(493, '14.7938', '14.8168', 'Bangka', 5, 'kalo rumah tingkat 2 hitung luasnya gmna ?', '', 'khusus', '1', '2017-02-28 09:10:51'),
(497, '14.8126', '14.8126', 'Bangka', 5, 'ini ada kasus dia melaut bulan ini tu dapetnya cuma sedikit karena musim jelek dan jadinya pengluaran > pndapatan, tpi pendapatan biasanya tu dia bisa dapet banyak dan kalo pake yang biasanya ini pndepatan > pengeluaran jdi how?', 'tanya pendapatan setahun yang lalu kemudian dibagi 12 ditambah dengan pendapatan bulan ini. begitu pula biaya produksinya, berapa biaya produksi tahun lalu dibagi 12 (atau dekati dengan biaya produksi 1 bulan) ditambah dengan biaya produksi bulan ini', 'khusus', '4', '2017-02-28 08:28:53'),
(499, '14.8126', '14.8126', 'Bangka', 5, 'kalo bayar pinjaman ke bank masuknya di pengeluaran yang apa ya? kalo menganggur kegiatan sminggu yang lalu masuknya apa?', 'tidak tercakup di pengeluaran\r\ntetapi catat aja di blok catatan seberapa yang dibayarkan.\r\n\r\nsementara gak tidak bekerja.. (pertanyaan kedua)', 'khusus', '4', '2017-02-28 11:01:38'),
(503, '14.8310', '14.8310', 'Bangka', 5, 'Kalau ada ruta yg punya kebun (+-udah 3 tahun), dan dia dari awal beli tanah, harga beli tanah di input atau tidak? kalau iya, di input dimana? modal?', 'untuk blok ketenagakerjaan, pada modal awal usaha lahan dan tanah tidak diimput', 'khusus', '4', '2017-02-28 12:38:28'),
(504, '14.8344', '14.7981', 'Bangka', 6, 'udah kelar sinar manik. udah kelar 4 ruta. hp belum kelar ini mau otewe penginapan', 'tapi kunci di aku yud wkwk', 'khusus', '4', '2017-12-22 03:07:30'),
(505, '14.8310', '14.8310', 'Bangka', 3, 'Apa yg terjadi kalau PCL mengubah salah 1 no ruta kuesioner tetapi nomor ruta tsb ternyata sudah ada di tab PCL, nah, kuesioner yg lama hilang, itu tertindih gitu ya?', 'Merubah untuk apa? Jika ada kesalahan pengisian dan sudah dikirim maka kortim dapat mengembalikan untuk diperbaiki', 'khusus', '4', '2017-02-28 13:42:56'),
(506, '14.7981', '14.7981', 'Bangka', 5, '1. responden nenek2 tinggal sendiri, punya masalah pendengaran. sepertinya tidak memungkinkan utk dicacah, bagaimana?', 'Tetap harus dicacah. Bisa meminta tolong  pada tetangga atau warga sekitar', 'khusus', '4', '2017-03-01 03:09:42'),
(507, '14.8310', '14.8310', 'Bangka', 5, 'Responden mengaku memiliki jaminan kesehatan BPJS, tetapi tidak mengeluarkan iuran sama sekali (tidak ada tarikan juga), nah itu tetap input BPJS atau JAMKESMAS(Buped), jadi di isi BPJS atau JAMKESMAS?', 'Izin menjawab, sekarang JAMKESMAS sudah tidak ada, sudah digantikan namanya dengan BPJS. BPJS yang tidak bayar sama sekali dan untuk masyarakat kalangan ke bawah itu sekarang ikut PBI. Yang dulunya ASKES sekarang masuk ke PPU', 'khusus', '4', '2017-03-01 01:20:13'),
(508, '14.8432', '14.8432', 'Bangka', 5, 'Ada responden yang benar-benar ga mau jawab salah satu pertanyaan. diisikan apa ya? di blok 15C', 'Tanyakan persepsi saja, biarkan responden memilih saja. Dekati responden dengan hati, pelan pelan saja. Buat suasana senyaman mungkin seperti responden yang bercerita tentang kehidupannya ^^', 'khusus', '4', '2017-03-01 03:16:28'),
(509, '14.8391', '14.8130', 'Bangka', 5, 'jika panen dalam jangka waktu 3 tahun sekali bagaimana input produksi pada usaha apakah harus dibagi 36 bulan?', '', 'khusus', '1', '2017-02-28 16:32:11'),
(510, '14.8391', '14.8130', 'Bangka', 5, 'jika panen dalam jangka waktu 3 tahun sekali bagaimana input produksi pada usaha apakah harus dibagi 36 bulan?', '', 'khusus', '1', '2017-02-28 16:32:14'),
(511, '14.8391', '14.8130', 'Bangka', 5, 'sayuran dari hasil kebun sendiri tapi tidak dibudidaya diinput pada bagian mana dalam capi? karena mempengaruhi nilai pendapatan dan pengeluaran rumah tangga sehingga pengeluaran lebih besar dari pendapatan', '', 'khusus', '1', '2017-02-28 16:35:02'),
(512, '14.8001', '14.8092', 'Bangka', 3, 'kalo di cek error gak ada yang tanda merah tapi pas mau simpan ada tulisan found 7 error . itu gimana ya ?', '', 'khusus', '1', '2017-02-28 17:01:55'),
(519, '14.8066', '14.8103', 'Bangka', 6, 'kalo ada non respon bagaimana solusinya? apakah ada penggantian sampel? atau dibiarkan saja? ', '', 'khusus', '1', '2017-12-22 03:07:30'),
(520, '14.8006', '14.8006', 'Bangka', 5, 'kalau rumah cm 1 petak, dan semuanya dilakukan disana makan tidur dll, jadi ruangan itu dianggap kamar apa engga? soalnya kalo 0 ga lewat rule validasi capi. anggap 1 ya?', 'Dianggap satu kamar', 'khusus', '4', '2017-03-01 02:46:05'),
(521, '14.8344', '14.7981', 'Bangka', 6, 'tanyaaaa', 'dmna yud? aku sama eka di kantor desa sinar manik', 'khusus', '4', '2017-12-22 03:07:30'),
(527, '14.8427', '14.8427', 'Bangka', 5, 'apabila ada responden yg benar2 menolak hanya bisa via telepon, apakah boleh diwawancara via telepon?', 'Tidak boleh. Untuk pencacahan pertama, diusahakan untuk mewawancarai secara langsung. Namun jika ada beberapa data yang perlu dikonfirmasi, bisa lewat telepon.', 'khusus', '4', '2017-03-01 03:10:55'),
(528, '14.8173', '14.8228', 'Bangka', 2, 'kalo responden ga punya hp, kolom no hp ksong gpp?', '', 'khusus', '1', '2017-03-01 03:18:11'),
(529, '14.8173', '14.8228', 'Bangka', 2, 'kalo responden ga punya hp, kolom no hp ksong gpp?', '', 'khusus', '1', '2017-03-01 03:18:13'),
(530, '14.8173', '14.8228', 'Bangka', 6, 'ini ada stiker yg berlebih, dibawa ke jkt ato ditempel2 di rumah warga smua?', '', 'khusus', '1', '2017-12-22 03:07:30'),
(532, '14.8427', '14.8427', 'Bangka', 2, 'pada kues 1501 disebutkan 2jt tapi pada rincian pengeluaran sebenarnya tiap bulan pengeliarannya 3jt lebih. sebenarnya tidak logi,namun ini kan blok yg percaya responden dan tdk boleh mengarahkan.dianggap valid atau tidak?', 'valid', 'khusus', '4', '2017-03-01 04:34:00'),
(533, '14.8427', '14.8427', 'Bangka', 3, 'pcl : 14.8038. blok 11b sampel sdh terkirim, dikortim tampilannya tadi jg sdh terkirim (dulu masalah sync yg bermasalah) nah tp krn tadi tiba2 ke close,trus coba di sync kan bs,tp tampilan malah jd kembali selesai listing(blm diambil sampel)', 'dulu ambil sampelnya offline / online wid ?,  yang ngambil pake akun kortim / pcl ?\r\ncoba di sync dulu, kalo masih gak bisa, di device yg dipake pas ambil sampel kirim file2 di folder penyimpanan  internal -> CAPI56 -> SaMS -> NIM yang ambil sampel \r\nmungkin bisa pc aja wid', 'khusus', '4', '2017-03-01 04:57:47'),
(534, '14.7948', '14.8253', 'Bangka', 6, 'BS 002B RW berapa?', '', 'khusus', '1', '2017-12-22 03:07:30'),
(535, '13.7733', '14.8442', 'Bangka', 2, 'Kartu Indonesia Sehat (KIS) masuk jaminan kesehatan yg mn? Dan ada iuran kaya BPJS tidak?', '', 'khusus', '1', '2017-03-01 07:50:34'),
(536, '14.8178', '14.8178', 'Bangka', 5, 'untuk responden yg pindah tempat , sedang sakit (rumahnya kosong), itu nanti dikues nya dipilih \"tidak dapat diwawancarai\" ?', 'Jika sampai hari ini tidak ada bisa diisi \"tidak dapat diwawancarai\" tetapi harus mengisi surat berita acara\r\nUntuk kasus org yg benar2 tidak ada ditempat bisa ditandatangani oleh ketua RT nya', 'khusus', '4', '2017-03-02 02:18:09'),
(537, '14.8427', '14.8427', 'Bangka', 3, 'pd halaman total pengeluaran non makanan terdapat rincian rata2 perbulan makanan non makanan dan pengeluaran ruta. tapi di rekapitulasi tidak muncul pengeluaran non makanan dan pengeluaran ruta. kenapa ya?', 'udah pake kuesioner terbaru, yg VKD.PKL56.RT ver1', 'khusus', '4', '2017-03-02 02:54:48'),
(538, '14.8427', '14.8427', 'Bangka', 3, 'sudah memakai kuesioner terbaru, masih sama tampilannya di rekapitulasi tidak muncul pengeluaran non makanan dan pengeluaran ruta. pdahal di halaman sebelumnya muncul', '', 'khusus', '3', '2017-03-02 03:29:18'),
(539, '14.7938', '14.8168', 'Bangka', 5, 'kerja jadi pemasaran di perusaan indomie masuk lapangan usaha mana ?', '', 'khusus', '1', '2017-03-02 03:51:36'),
(540, '14.8006', '14.8006', 'Bangka', 5, 'surat pernyataan non respons yg tidak ditemui harus rt ya? pak kades boleh?', '', 'khusus', '3', '2017-03-02 04:50:11'),
(541, '14.8006', '14.8006', 'Bangka', 5, 'surat pernyataan non respons yg tidak ditemui harus rt ya? pak kades boleh?', 'Boleh\r\nsumber : sekpul Bangka', 'umum', '4', '2017-03-02 05:48:15'),
(542, '14.8060', '14.8060', 'Bangka', 5, 'kenapa pekerja keluarga tidak dibayar tidak bisa pendapatannya 0 di blok XI?', 'Tuliskan \"1\" untuk pendapatan pekerja tidak dibayar', 'umum', '4', '2017-03-04 01:15:10'),
(543, '14.8060', '14.8060', 'Bangka', 5, 'jam kerja utamanya 8 jam, terus di jumlah jam kerja keseluruhannya 16 jam, tapi tetap dianggap error. kenapa ya?', 'Jumlah jam keseluruhan adalah total jam kerja selama 1 minggu\r\nApakah sudah diperhatikan utk menjumlah seluruh jam kerja dalam seminggu?', 'khusus', '4', '2017-03-04 01:16:56'),
(544, '14.7978', '14.8060', 'Bangka', 6, 'jika dlm satu rumag tangga,  ada ibu, anak dan keponakan.  namun saat di tanya pendapatan keponakannya, respondennya gk tahu,  sudah diminta untuk diperkirakan tp katanya tidak pernah ditanyakan. jdnya gimana? pekerjaanya karyawan ditoko ', '', 'khusus', '1', '2017-12-22 03:06:37'),
(545, '14.8256', '14.8256', 'Bangka', 3, 'pcl saya gagal unduh 2 kuesioner 19-01-090-019-006B-17,37 yang kuesioner jenis periksa kembali a.n. Thandio KT213 tolong tanggapan nya', '', 'khusus', '3', '2017-03-04 15:16:38'),
(546, '14.8256', '14.8256', 'Bangka', 3, 'pcl saya gagal unduh 2 kuesioner 19-01-090-019-006B-17,37 yang kuesioner jenis periksa kembali a.n. Thandio KT213 tolong tanggapan nya', '', 'khusus', '3', '2017-03-04 15:16:40'),
(547, '14.8256', '14.8256', 'Bangka', 3, 'pcl saya gagal unduh 2 kuesioner 19-01-090-019-006B-17,37 yang kuesioner jenis periksa kembali a.n. Thandio KT213 tolong tanggapan nya', '', 'khusus', '3', '2017-03-04 15:16:47'),
(548, '14.8432', '14.8432', 'Bangka', 5, 'sumber pemasukan baru terdeteksi di akhir wawancara. karena sudah magrib, wawancara dihentikan dan bilang \'bakal kembali lagi\'. namun karena terbatasnya waktu, tidak sempat balik dan ditelfon tidak bisa. yg belum: modal, lama bekerja, jam seminggu', '', 'khusus', '3', '2017-03-05 23:23:06'),
(549, '14.8420', '14.8437', 'Bangka', 6, 'Kami kehilangan papi a.n Bp Antim dg nama kues 011B no ruta 06 Lubuk Pabrik Lubuk Besar Bangka Tengah, \nboleh minta nomer hp nya?', '', 'khusus', '1', '2017-12-22 03:07:30'),
(550, '14.8420', '14.8437', 'Bangka', 6, 'Kami kehilangan papi a.n Bp Antim dg nama kues 011B no ruta 06 Lubuk Pabrik Lubuk Besar Bangka Tengah, \nboleh minta nomer hp nya?', '', 'khusus', '1', '2017-12-22 03:07:30'),
(551, '14.8427', '14.8427', 'Bangka', 3, 'ketika mau lihat sampel taman sari kelurahan rawa bangun 005B, selalu force closed. kalo ga salah ini yang kemaren sempat request resampling. kemudian ketika lihat sampel rawa bangun 011B tidak ada daftar sampel padahal sampel terkirim.', '', 'khusus', '3', '2017-03-07 05:19:59'),
(552, '14.8432', '14.8432', 'Bangka', 3, 'progress di pcl setelah kirim kuesioner tidak berubah. mohon solusinya', '', 'khusus', '3', '2017-03-07 10:21:26'),
