INSERT INTO `sipadu_pengumuman` (`title`, `waktu`, `content`, `foto`, `id_berita`, `dibuat`) VALUES
('Selamat Datang di Sikoko', '2017-12-28', '<hr />\r\n<p style=\"text-align:justify\"><em>Assalamu&rsquo;alaykum warahmatullah wabarakatuh.</em></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Selamat datang di web Sikoko, kami dari Bidang TIK Seksi Sistem Komunikasi dan Kolaborasi (Sikoko) dengan bangga telah merilis web sipadu PKL STIS T.A. 2017/2018. Semoga dapat bermanfaat bagi kita semua. Apabila ada pertanyaan, dapat menghubungi nomor <em>Customer Service </em>(CS) yang tertera di halaman FAQ.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Bagi mahasiswa yang belum mengganti <em>password default </em>silakan segera mengganti <em>password </em>Anda pada halaman profil. Terimakasih atas perhatian yang diberikan.</p>\r\n\r\n<p style=\"text-align:justify\"><em>Wassalamu&rsquo;alaykum warahmatullah wabarakatuh</em></p>\r\n\r\n<hr />\r\n<p style=\"text-align:justify\"><strong>NB:</strong> Presensi belum valid dikarenakan presensi dari rapat-rapat yang telah diselenggarakan belum seluruhnya direkap<br />\r\n--</p>\r\n\r\n<p>Panitia Praktik Kerja Lapangan<br />\r\nSekolah Tinggi Ilmu Statistik<br />\r\nTahun Akademik 2017/2018</p>\r\n', '2ba904b1b0ec66df2556ba1f5727c30e.png', 15, 'Amalia Kuntie Aisyah'),
('<strong>REVISI</strong> Pembagian Modul Untuk Bidang KOR, Metodologi, TIK, dan Umum', '2017-12-26', '<p style=\"text-align:justify\"><em>Assalamu&rsquo;alaykum warahmatullah wabarakatuh.</em></p>\r\n\r\n<p style=\"text-align:justify\">Selamat sore, setelah mempertimbangkan satu dan lain hal, berikut terlampir file&nbsp;<strong>REVISI</strong>&nbsp;pengumuman Pembagian Modul untuk Bidang KOR, Metodologi, TIK, dan Umum PKL STIS Tahun Akademik 2017/2018. Mohon maaf atas ketidaknyamanan yang terjadi.&nbsp;Sekian pemberitahuan yang disampaikan, untuk perhatiannya kami ucapkan terimakasih.</p>\r\n\r\n<p style=\"text-align:justify\"><em>Wassalamu&rsquo;alaykum warahmatullah wabarakatuh</em></p>\r\n\r\n<p style=\"text-align:justify\"><em><a href=\"http://drive.google.com/file/d/0BzO39jNt7qBeSnJ3ckx0SWFONGMyOHptMEI0RjNZX3pfNXVn/view\" target=\"_black\">Lampiran</a></em></p>\r\n', '', 7, 'Amalia Kuntie Aisyah'),
('Launching Website PKL ', '2018-01-09', '<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Halo! Kembali lagi dengan Sikoko, kali ini kami akan merilis salah satu produk unggulan setelah kemarin me<em>launching</em>&nbsp;Sipadu PKL.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Bidang TIK Seksi Sistem Komunikasi dan Kolaborasi (Sikoko) dengan bangga telah merilis <span style=\"color:#2980b9\"><a href=\"http://pkl.stis.ac.id\" target=\"_blank\"><strong>Website PKL STIS T.A. 2017/2018</strong></a></span> yang berisi ulasan singkat mengenai PKL STIS T.A. 2017/2018, timeline kegiatan PKL secara umum, struktur organisasi PKL, berita terkini, dan galeri yang memuat foto-foto kegiatan yang telah dilaksanakan.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Anda dapat mengunjungi web tersebut di&nbsp;link<span style=\"color:#3498db\"><a href=\"http://pkl.stis.ac.id\" target=\"_blank\"> <strong>http://pkl.stis.ac.id/</strong></a></span> (web PKL angkatan 55-57) atau&nbsp;<span style=\"color:#3498db\"><strong><a href=\"http://pkl.stis.ac.id/57\" target=\"_blank\">http://pkl.stis.ac.id/57</a></strong></span> (web PKL angkatan 57). Pastikan&nbsp;&nbsp;kamu sering mengunjungi web PKL agar kamu <em>nggak</em>&nbsp;<em>kudet</em> dan ketinggalan info-info penting, ya!</p>\r\n\r\n<p style=\"text-align:justify\">Terimakasih atas perhatian yang diberikan, semoga bermanfaat.</p>\r\n', 'bc35eefcfb75e594f5d821c482aa4d16.jpeg', 27, 'Amalia Kuntie Aisyah');
